import "@egjs/react-flicking/dist/flicking.css";

function Slider() {
  return (
    <div>
      {" "}
      <Flicking
        align="prev"
        circular={true}
        onMoveEnd={(e) => {
          console.log(e);
        }}
      >
        <div className="panel"></div>
        <div className="panel">2</div>
        <div className="panel">3</div>
      </Flicking>
    </div>
  );
}

export default Slider;
